inline double GetConvBDTProb(const double x[28], const double LearingRate = 0.2, const int n_estim = 20)
{
    double prob = 0.;
    for (int iestim = 0; iestim < n_estim; iestim++)
    {
        prob += LearingRate * GetConvBDTValue(x, iestim);
    }
    
    return 1. / ( 1. + exp( - prob ) );
}
inline int GetConvBDT(const double x, const double y[3], const double LearingRate = 0.2, const int n_estim = 20)
{
    if ( x > y[2] ) return 1000;
    if ( x > y[1] ) return 100;
    if ( x > y[0] ) return 10;
    return 0;
    
}//double mytree['NBDThit', 'Pt', 'Phi0', 'The0', 'PhiDC', 'ZDC', 'Alpha', 'Ecore', 'Centrality', 'Charge', 'Arm', 'sdphi0', 'sdthe0', 'SecondHitPhiR0', 'SecondHitPhiL0', 'SecondHitTheR0', 'SecondHitTheL0', 'sdphi1', 'sdthe1', 'SecondHitPhiR1', 'SecondHitPhiL1', 'SecondHitTheR1', 'SecondHitTheL1', 'sdphi2', 'sdthe2', 'SecondHitPhiR2', 'SecondHitPhiL2', 'SecondHitTheR2', 'SecondHitTheL2', 'sdphi3', 'sdthe3', 'SecondHitPhiR3', 'SecondHitPhiL3', 'SecondHitTheR3', 'SecondHitTheL3']
